css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #808080;
  padding: 5px;
  border-bottom: 1px solid #222326;
}
.github-Accordion-header::-webkit-details-marker {
  color: #808080;
}
.github-Accordion-content {
  border-bottom: 1px solid #222326;
  background-color: #35373b;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #808080;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #f0f0f0;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 2.5px;
  border-bottom: 1px solid #222326;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #414349;
}
